import styled from 'styled-components/native';

export const Body = styled.View`
    flex: 1;
    background: #8B10AE;
    padding-top: 30;
    align-items: center;
    justify-content: center;
`

export const Main = styled.View`
    flex: 1;
`

export const Objective = styled.Text`
  font-size: 25;
  color: white;
  padding: 10px;
  font-weight: bold;
  text-align: center;
  height: 70;
  /* z-index:2; */
`

export const TextArea = styled.View`
    flex-direction: row;
    align-items: flex-end;
    margin-bottom: 10px;
`

export const N1 = styled.Text`
    width: 90px;
    height:100px;
    margin-right:20px;
    text-align: center;
    font-size: 30px;
    line-height: 100px;
    background-color: #eee;
`

export const TextInput = styled.TextInput`
    width: 90px;
    height:100px;
    float: left;
    text-align: center;
    font-size: 30px;
    line-height: 100px;
    background-color: #eee;
`

export const Button = styled.Button`
    height: 40xp;
`
